import {
  BlobProvider,
  Page,
  Text,
  View,
  Document
} from '@react-pdf/renderer';

const MyDoc = (
  <Document>
    <Page>
      <View>
        <Text>Section #1</Text>
      </View>
      <View>
        <Text>Section #2</Text>
      </View>
    </Page>
  </Document>
);

const PDF = () => (
  <BlobProvider document={MyDoc}>
    {({ blob, url }) => (
      // return something using blob or url
      <div>{url}{blob}</div>
    )}
  </BlobProvider>
);


export default PDF;
